.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

.sr-only-focusable:active,
.sr-only-focusable:focus {
  position: static;
  width: auto;
  height: auto;
  margin: 0;
  overflow: visible;
  clip: auto;
}

html.chat,
html.chat body {
  height: 100%;
}

body {
  padding-top: 70px;
}

.login {
  background: #eceeef;
}

.login-box {
  background: #fff;
  padding: 20px 10px 10px 10px;
  border: 1px solid #d0d5d8;
  border-radius: 3px;
}

.messages {
  max-height: 50vh;
  overflow: scroll;
  border: 1px solid #E5E5EA;
  padding: 10px;
}

.message-box {
  margin-bottom: 20px;
}

.message-editor {
  padding: 10px;
}

.from-me .message {
  position: relative;
  padding: 10px 20px;
  color: white;
  background: #0275d8;
  border-radius: 25px;
}

.from-me .message.pending {
  background: #9AC8EF;
}

.from-me .message:before {
  content: "";
  position: absolute;
  z-index: -1;
  bottom: -2px;
  right: -7px;
  height: 20px;
  border-right: 20px solid #0275d8;
  border-bottom-left-radius: 16px 14px;
  -webkit-transform: translate(0, -2px);
}

.from-me .message.pending:before {
  border-right-color: #9AC8EF;
}

.from-me .message:after {
  content: "";
  position: absolute;
  z-index: 1;
  bottom: -2px;
  right: -56px;
  width: 26px;
  height: 20px;
  background: white;
  border-bottom-left-radius: 10px;
  -webkit-transform: translate(-30px, -2px);
}

.from-them .message {
  position: relative;
  padding: 10px 20px;
  background: #E5E5EA;
  border-radius: 25px;
  color: black;
}

.from-them .message:before {
  content: "";
  position: absolute;
  z-index: 2;
  bottom: -2px;
  left: -7px;
  height: 20px;
  border-left: 20px solid #E5E5EA;
  border-bottom-right-radius: 16px 14px;
  -webkit-transform: translate(0, -2px);
}

.from-them .message:after {
  content: "";
  position: absolute;
  z-index: 3;
  bottom: -2px;
  left: 4px;
  width: 26px;
  height: 20px;
  background: white;
  border-bottom-right-radius: 10px;
  -webkit-transform: translate(-30px, -2px);
}

.author {
  font-size: 12px;
  padding-left: 20px;
}

.time {
  text-align: right;
  font-size: 10px;
}

.btn-lg,
.btn-group-lg > .btn {
  padding: 13px 16px;
}

